import React from 'react'

const Footer = () => {
  return (
    <div className='footer'>
        <img src="https://www.clipartmax.com/png/full/36-363919_jyv%C3%A4skyl%C3%A4n-paviljonki-twitter-logo-white-vector.png" height={35} width={45} color="green"></img>
        <img src="https://www.pinclipart.com/picdir/big/197-1976275_facebook-instagram-twitter-goodreads-rss-facebook-vector-clipart.png" height={45} width={45}></img>
        <img src="https://www.clipartmax.com/png/full/231-2312557_500-instagram-logo-instagram-logo-white-vector.png" height={45} width={45}></img>
    </div>

  )
}

export default Footer
